  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The MCBS team is in the process of reviewing
  data operations, and as part of this work, we are utilizing a new administrative
  source for determining Medicaid participation in order to be more consistent with
  guidelines suggested by the Federal Medicare-Medicaid Coordination Office at the
  Centers for Medicare and Medicaid Services (CMS). This paper describes the impact
  this change will have on estimates of Medicare-Medicaid enrollees in the MCBS.</p>n\",\n\t\"license_title\":
